import { createApp } from 'vue'
import App from './App.vue'
import * as VueGoogleMaps from 'vue3-google-maps'


createApp(App).mount('#app')

Vue.use(VueGoogleMaps, {
    load: {
      key: 'YOUR_GOOGLE_MAPS_API_KEY_GOES_HERE',
      libraries: 'places',
    }
  });
